import React, { useState } from 'react';
import { 
  Search, 
  Filter, 
  Grid, 
  List, 
  Star, 
  Download,
  Plus,
  Palette,
  Sparkles,
  Check,
  Eye
} from 'lucide-react';
import { useQuery } from '@tanstack/react-query';
import axios from 'axios';
import toast from 'react-hot-toast';

interface Template {
  id: number;
  name: string;
  description: string;
  category: string;
  style: string;
  preview_url: string;
  is_premium: boolean;
  is_favorite: boolean;
  usage_count: number;
  average_rating: number | null;
}

const Templates: React.FC = () => {
  const [viewMode, setViewMode] = useState<'grid' | 'list'>('grid');
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState<string>('all');
  const [selectedStyle, setSelectedStyle] = useState<string>('all');
  const [previewTemplate, setPreviewTemplate] = useState<Template | null>(null);

  const { data: templates, isLoading } = useQuery<Template[]>({
    queryKey: ['templates'],
    queryFn: async () => {
      // Mock data
      return [
        {
          id: 1,
          name: 'Promoção Restaurante',
          description: 'Template elegante para promoções de comida',
          category: 'restaurant',
          style: 'elegant',
          preview_url: 'https://placehold.co/400x400/FF6B35/FFFFFF?text=Restaurante',
          is_premium: false,
          is_favorite: true,
          usage_count: 45,
          average_rating: 4.8
        },
        {
          id: 2,
          name: 'Oferta Supermercado',
          description: 'Template vibrante para ofertas de mercado',
          category: 'supermarket',
          style: 'bold',
          preview_url: 'https://placehold.co/400x400/2A9D8F/FFFFFF?text=Supermercado',
          is_premium: false,
          is_favorite: false,
          usage_count: 32,
          average_rating: 4.5
        },
        {
          id: 3,
          name: 'Moda Fashion',
          description: 'Template moderno para coleções de moda',
          category: 'clothing',
          style: 'modern',
          preview_url: 'https://placehold.co/400x400/E63946/FFFFFF?text=Moda',
          is_premium: true,
          is_favorite: false,
          usage_count: 28,
          average_rating: 4.9
        },
        {
          id: 4,
          name: 'Beleza Premium',
          description: 'Template sofisticado para serviços de beleza',
          category: 'beauty',
          style: 'elegant',
          preview_url: 'https://placehold.co/400x400/FFAFCC/FFFFFF?text=Beleza',
          is_premium: true,
          is_favorite: true,
          usage_count: 19,
          average_rating: 4.7
        },
        {
          id: 5,
          name: 'Serviços Profissionais',
          description: 'Template clean para prestação de serviços',
          category: 'services',
          style: 'minimal',
          preview_url: 'https://placehold.co/400x400/3A86FF/FFFFFF?text=Serviços',
          is_premium: false,
          is_favorite: false,
